import React, { useState } from 'react'
import { Button, Input, TextField, Grid } from '@material-ui/core'
import { PropObject } from '../../generated/graphql'
import { SectionHeader, SectionContainer, BasicContentBox } from '../StyledComponents'

interface Props {
    property: PropObject
}


export const AddLocation: React.FC<Props> = (props) => {


    const [id, setId] = useState(" ")
    const [title, setTitle] = useState(" ")
    const [subtext, setSubtext] = useState(" ")
    const [long, setLong] = useState(" ")
    const [lat, setLat] = useState(" ")
    const [location, setLocation] = useState(" ")

    const prop = props.property;

    if(prop){
        setId(prop.id+"");
        setTitle(prop.title);
        setSubtext(prop.subtext);
        setLat(prop.lat);
        setlong(prop.long);
        setLocation(prop.location)
    }

    return (

        <SectionContainer>
            <BasicContentBox>
                <SectionHeader>
                    Location hinzuf√ºgen
                </SectionHeader>

                <form action="http://localhost:4000/upload/property/image" method="POST" encType="multipart/form-data">
                     <Grid container direction="column" spacing={4}>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Property ID"
                                    value={id} 
                                    onChange={e => {
                                        // dataChanged(e);
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Titel"
                                    value={title} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Subtext"
                                    value={subtext} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Location"
                                    value={location} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Longitude"
                                    value={long} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Latitude"
                                    value={lat} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <Input name="myImage" type="file" />
                        </Grid>
                        <Grid item>
                            <Button variant="contained" type="submit">
                                speichern
                            </Button>
                        </Grid>
                    </Grid>   
                </form>

            </BasicContentBox>
        </SectionContainer>

       )

}
